            new [] { "990716", "10.0.1.5:11211", "10.0.1.6:11211", "10.0.1.4:11211" },    // Key hash: 4294684223
            new [] { "226942", "10.0.1.5:11211", "10.0.1.6:11211", "10.0.1.4:11211" },    // Key hash: 4294854594

        };

        #endregion

        // This is a list of 7 servers for which we know the first and the last ketama key point to different servers
        private static String[] _test07Servers =
        {
                "10.0.1.1:11211",
                "10.0.1.2:11211",
                "10.0.1.3:11211",
                "10.0.1.4:11211",
                "10.0.1.6:11211",
                "10.0.1.7:11211",
                "10.0.1.8:11211",
        };

        // In this list of 8 servers, the first and the last ketama key point to the same server 10.0.1.5:11211
        private static String[] _test08Servers =
        {
                "10.0.1.1:11211",
                "10.0.1.2:11211",
                "10.0.1.3:11211",
                "10.0.1.4:11211",
                "10.0.1.5:11211",
                "10.0.1.6:11211",
                "10.0.1.7:11211",
                "10.0.1.8:11211",
        };

        private static List<IMemcacheNode> _test07Nodes;
        private static List<IMemcacheNode> _test08Nodes;

        [TestFixtureSetUp]
        public void Setup()
        {
            _test07Nodes = _test07Servers.
                        Select(s => new MockNode(new IPEndPoint(IPAddress.Parse(s.Substring(0, s.IndexOf(':'))), 11211))).
                        Cast<IMemcacheNode>().
                        ToList();

            _test08Nodes = _test08Servers.
                        Select(s => new MockNode(new IPEndPoint(IPAddress.Parse(s.Substring(0, s.IndexOf(':'))), 11211))).
                        Cast<IMemcacheNode>().
                        ToList();
        }


        [Test]
        public void TestLocatorAllNodesAlive()
        {
            RunTestLocatorAllNodesAlive(_test07Nodes, _expected07);
            RunTestLocatorAllNodesAlive(_test08Nodes, _expected08);

        }

        private void RunTestLocatorAllNodesAlive(List<IMemcacheNode> nodes, IEnumerable<string[]> expected)
        {
            INodeLocator ketama = new KetamaLocator();
            ketama.Initialize(nodes);

            foreach (var tuple in expected)
            {
                var keyAsBytes = Encoding.UTF8.GetBytes(tuple[0]);

                var locations = ketama.Locate(new RequestKeyWrapper(keyAsBytes));
                Assert.IsNotEmpty(locations, "KetamaLocator found no node");

                var nodeEnumerator = locations.GetEnumerator();

                int idx = 1;
                while (idx < tuple.Length)
                {
                    nodeEnumerator.MoveNext();
                    var node = nodeEnumerator.Current;
                    Assert.AreEqual(tuple[idx++], node.EndPoint.ToString(), "Unexpected node returned by the Ketama locator. Key: {0}", tuple[0]);
                }
            }
        }

        [Test]
        public void TestLocatorOneNodeIsDead()
        {
            INodeLocator ketama = new KetamaLocator();

            // Kill node 10.0.1.7:11211 by removing it from the list.
            _test08Nodes.RemoveAt(6);

            ketama.Initialize(_test08Nodes);

            foreach (var tuple in _expected08)
            {
                var keyAsBytes = Encoding.UTF8.GetBytes(tuple[0]);

                var locations = ketama.Locate(new RequestKeyWrapper(keyAsBytes));
                Assert.IsNotEmpty(locations, "KetamaLocator found no node");
                var nodeEnumerator = locations.GetEnumerator();

                int expectedIdx = 0;
                foreach(var _ in Enumerable.Range(0,2))
                {
                    nodeEnumerator.MoveNext();
                    var node = nodeEnumerator.Current;
                    Assert.IsNotNull(node, "Null node");

                    if (tuple[++expectedIdx] ==  "10.0.1.7:11211")
                        expectedIdx++;

                    Assert.AreEqual(tuple[expectedIdx], node.EndPoint.ToString(), "Unexpected node returned by the Ketama locator. Key: {0}", tuple[0]);
                }
            }
        }

        [TestCase("", "")]
        [TestCase("1", "0")]
        [TestCase("1, 1, 1, 1, 1, 1, 1", "0")]
        [TestCase("1, 1, 1, 3, 1, 1, 1", "2, 3")]
        [TestCase("1, 2, 1, 2, 1, 2", "0, 1, 2, 3, 4, 5")]
        [TestCase("1, 1, 2, 1, 1, 2, 2, 2, 2, 1, 2, 1, 2, 1, 2, 1", "1, 2, 4, 8, 9, 10, 11, 12, 13, 14")]
        [TestCase("3, 1, 4, 8, 5, 6, 6, 2, 2, 1, 8, 7, 4, 3, 5, 5",  "0, 1, 2, 3, 4, 6, 8, 9, 10, 11, 12, 13, 15")]
        public void TestCleanRepeatedNodes(string serverOrder, string expectedKeys)
        {
            List<int> serverOrderList = new List<int>(serverOrder.Replace(" ", String.Empty)
                                                                 .Split(',')
                                                                 .Where(s => s != "")
                                                                 .Select(Int32.Parse));

            Dictionary<uint, IMemcacheNode> keyToServer  = serverOrderList.Select((value, index) => new { value, index })
                                                                      .ToDictionary(pair => (uint)pair.index, pair => _test08Nodes[pair.value-1]);

            uint[] sortedKeys = KetamaLocator.CleanRepeatedNodes(Enumerable.Range(0, serverOrderList.Count).Select(x => (uint)x).ToList(), keyToServer);

            CollectionAssert.AreEqual(expectedKeys.Replace(" ", String.Empty), String.Join(",", sortedKeys), "CleanRepeatedNodes failed");
        }
    }

